import axios from "axios";
import React, { useEffect, useState } from "react";

const Api = () => {
  var [data1, setData1] = useState([]);
  useEffect(() => {
    axios
      .get("https://geton.yarainfotech.com/get-data.php")
      .then(function (response) {
        setData1(response.data);

        // console.log(response);
      });
  }, []);
  return (
    <>
      <table border={2} cellPadding={7} cellSpacing={2}>
        <tr>
          <th>created_at</th>
          <th>Email</th>
          <th>Name</th>
          <th>Password</th>
          <th>Updated_at</th>
        </tr>

        {data1.map((e) => {
          console.log(e);
          return (
            <>
              <tr>
                <td>{e.id}</td>
                <td>{e.email}</td>
                <td>{e.name}</td>
                <td>{e.password}</td>
              </tr>
            </>
          );
        })}
      </table>
    </>
  );
};
export default Api;
